//Definefunctions
FUNCTION EmailContains(phrases)
{
	phraseList = phrases.split(",")
	DebugLog("DEBUG","EmailContains {phraseList}")
	FOREACH phrase IN phraseList
  	{
    	IF global:emailSubject.lower().contains(phrase)
    	{
      		DebugLog("DEBUG","	- found phrase in subject - {phrase}")
			RETURN true
    	}

		FOREACH line IN global:emailBody
    	{
      		IF line.lower().contains(phrase)
      		{
        		DebugLog("DEBUG","	- found phrase '{phrase}' in line - '{line}'")
				RETURN true
      		}
  		}
	}
  	RETURN false
}

FUNCTION EmailFrom(searchList)
{
	DebugLog("DEBUG","Email from email {global:emailFrom} - searching for {searchList}" )
	IF searchList.contains("{global:emailFrom}")
	{
		DebugLog("DEBUG","	- found email from '{global:emailFrom}' in line - '{searchList}'")
		RETURN true
	}
	RETURN false
}

FUNCTION EmailTo(searchItems)
{
	DebugLog("DEBUG","Email to checking for {searchItems} in {emailTo}" )
	searchList = searchItems.split(",")
	IF searchList.count() > 0
	{
		FOR i = 1 TO searchList.count()
		{
		
			IF global:emailto.contains(searchList[i])
			{
				DebugLog("DEBUG","	- found {searchList[i]} in {emailTo}" )
				RETURN true
			}	
		}
	}
	RETURN false
}

FUNCTION EmailCC(searchItems)
{
	DebugLog("DEBUG","Email CC checking for {searchItems} in {emailCC}" )
	searchList = searchItems.split(",")
	IF searchList.count() > 0
	{
		FOR i = 1 TO searchList.count()
